            <p style={{ backgroundColor: "#ddd", padding: "10px" }}>{props.show.abstract}</p>
            <h3>Famous authors</h3>
            <ul>
                {props.show.authors.map((author, index) => (
                    <li key={index}>
                        {props.show.author}
                        {props.show.birth[index] && ` (${birth[index]} - `}
                        {props.show.death[index] && `${death[index]})`}
                    </li>
                ))}
            </ul>
        </div>
    );
}

